    let sign = '+';
    let num = 0;
    for (let i = 0; i < s.length; i++) {
        if (s[i] === ' ') continue;
        if (isNaN(s[i])) {
            sign = s[i];
        } else {
            num = num * 10 + parseInt(s[i]);
            if (sign === '+') {
                stack.push(num);
            } else if (sign === '-') {
                stack.push(-num);
            } else if (sign === '*') {
                stack.push(stack.pop() * num);
            } else if (sign === '/') {
                stack.push(parseInt(stack.pop() / num));
            }
            num = 0;
        }
    }
    return stack.reduce((a, b) => a + b);
}

