int main() {
    std::ios_base::sync_with_stdio(0);
    cin.tie(0);
    cout.precision(10);

    string a, b;
    cin >> a >> b;

    int n = a.size();
    int m = b.size();

    vector<int> result(n + m, 0);

    for (size_t i = 0; i < n; ++i) {
        for (size_t j = 0; j < m; ++j) {
            result[i + j + 1] += (a[i] - '0') * (b[j] - '0');
        }
    }

    for (size_t i = result.size() - 1; i > 0; --i) {
        result[i - 1] += result[i] / 10;
        result[i] %= 10;
    }

    int i = 0;
    while (result[i] == 0) {
        ++i;
    }

    for (; i < result.size(); ++i) {
        cout << result[i];
    }

    if (i == result.size()) {
        cout << 0;
    }

    cout << endl;

    return 0;
}

