public:
    int calculate(string s) {
        int len = s.size();
        if(len == 0) return 0;
        stack<int> nums;
        stack<char> ops;
        int num = 0;
        for(int i = 0; i < len; i++){
            if(s[i] >= '0'){
                num = num * 10 + s[i] - '0';
            }
            else{
                nums.push(num);
                num = 0;
                if(!ops.empty() && ops.top() == '*'){
                    ops.pop();
                    int a = nums.top();
                    nums.pop();
                    int b = nums.top();
                    nums.pop();
                    nums.push(a * b);
                }
                if(!ops.empty() && ops.top() == '/'){
                    ops.pop();
                    int a = nums.top();
                    nums.pop();
                    int b = nums.top();
                    nums.pop();
                    nums.push(b / a);
                }
                ops.push(s[i]);
            }
        }
        nums.push(num);
        while(!ops.empty()){
            char op = ops.top();
            ops.pop();
            int a = nums.top();
            nums.pop();
            int b = nums.top();
            nums.pop();
            if(op == '+') nums.push(a + b);
            else nums.push(b - a);
        }
        return nums.top();
    }
};

